    function retreiveIndex(uint[] memory list, uint value) public pure returns (bool b, uint u) {
        uint j = 0;
        for (uint i = 0; i < list.length; i++) {
            if (list[i] == value) {
                b = true;
                u = i;
                break;
            }  
            j++;
        }
        if (j == list.length) {
            b = false;
            u = j;
        }
    }

